import React, { Component } from 'react'

export class Item extends Component {
    
  render() {
    return (
      <div>
        <ul>
        {props.myArray.map((item) => (
          <li key={item}>{item + 10}</li>
        ))}
      </ul>
      </div>
    )
  }
}

export default Item
